import dids from "../../data/dids.json"

const getDidData = () => {
  let i = 0;
  let searchDid = [];

  dids['dids'].forEach(did => {
    searchDid.push([
      {
        key: i,
        type: "did", 
        data: did['did']
      },
      {
        key: i,
        type: "line",
        data: did['line']
      },
      {
        key: i,
        type: "location",
        data: did['location']
      },
      {
        key: i,
        type: "area",
        data: did['area']
      },
      {
        key: i,
        type: "description",
        data: did['description']
      },
      {
        key: i,
        type: "",
        data: ""
      },
    ])
  })

  return searchDid
}

export default getDidData();
